import React from "react";
import Container from 'react-bootstrap/Container';
import ProfilePicture from "./ProfilePicture";
import Dots from "./Dots";


function About() {
  return (
    <div>
      <Container fluid className="middle-container">
        <ProfilePicture />
        <Dots />
      </Container>
    </div>
  );
}

export default About;
